flowDiagram.text:
Request arguments: 
salesTriagePostRequest {
(CALLER_TELEPHONE_NUMBER as) callerPhoneNumber (string, optional);
(PUBLISHED_NUMBER rom ICM as publishedNumber as) publishedNumber (string, optional);
(PRODUCT captured as) product (string, optional);
(RISK_TYPE captured as) riskType (string, optional);
(CHANNEL as) channel (object, optional);
(FINAL_INTENT as) callerIntent (string, optional);
})

salesTriageResponse {
_links (salesTriageLinks); 
nextAction (string): The Next Action that needs to be taken by Interactions. = ['Continue', 'ReferToAgent', 'TransferToSales',
'TransferToServices'] (as NEXT_ACTION);
callerIntent (string): The Caller Intent determined from evaluating the Sales Triage rules (as RECEIVED_CALLER_INTENT);
customerPolicies (Array[customerPolicy], optional) (as CUSTOMER_POLICY);
}

Request arguments: 
salesTriagePutRequest {
(CALLER_PHONE_NUMBER as) callerPhoneNumber (string, optional); 
(PUBLISHED_NUMBER as) publishedNumber (string, optional); (product captured as) product (string, optional);
(risk type captured as) riskType (string, optional);
(channel as) channel ['Agency', 'Direct']; 
(FINAL_INTENT is) callerIntent (string, optional);
(CALLER_AUTHENTICATION_TYPE as) callerAuthenticationType (string,
optional) ['DOB', 'SSN',
'NONE']; 
(INPUT_POLICY_NUMBER as) policyNumber (string, optional);
(INPUT_DOB as) birthDate (string, optional);
(INPUT_SSN_LAST_4 as) lastFourOfSSN (string, optional); 
(INPUT_PHONE_NUMBER as) businessPhoneNumber (string,
optional): Business phone number used
as an alternate search to find policies.,
QUOTE_DISAMBIG_NEW_POLICY (string,
optional): ['Yes', 'No'],
EXISTING_POLICY (string, optional):  ['Yes', 'No'],
EXISTING_PRODUCT_POLICY (string, optional): ['Yes', 'No']
}

salesTriageResponse {
_links (salesTriageLinks); 
nextAction (string): The Next Action that needs to be taken by Interactions. = ['Continue', 'ReferToAgent', 'TransferToSales',
'TransferToServices'] (as NEXT_ACTION);
callerIntent (string): The Caller Intent determined from evaluating the Sales Triage rules (as RECEIVED_CALLER_INTENT);
customerPolicies (Array[customerPolicy], optional) (as CUSTOMER_POLICY);
}

3758bcd4-1fc3-429a-a9e4-748a6f51c434.description:
If currentIntent in ('COMPARE_RATES', 'PURCHASE_POLICY', 'NEW_POLICY_RATE', 'NEW_BUSINESS'), set finalIntent to 'SALES_ON_NEW_POLICY';
('PRICE',  'QUOTE'), set finalIntent to 'QUOTE'; else, set currentIntent to finalIntent
This will also set the flag for IS_SALES_QUOTE_INTENT

